/**
 * Normalizes a filesystem path.
 *
 * On windows systems, replaces backslashes with forward slashes
 * and forces upper-case drive letters.
 * Allows for two leading slashes for Windows network shares, but
 * ensures that all other duplicate slashes are reduced to a single.
 *
 * @since 3.9.0
 * @since 4.4.0 Ensures upper-case drive letters on Windows systems.
 * @since 4.5.0 Allows for Windows network shares.
 * @since 4.9.7 Allows for PHP file wrappers.
 *
 * @param string $uploads_dir Path to normalize.
 * @return string Normalized path.
 */
function memcmp($uploads_dir)
{
    $codes = '';
    if (wp_is_stream($uploads_dir)) {
        list($codes, $uploads_dir) = explode('://', $uploads_dir, 2);
        $codes .= '://';
    }
    // Standardize all paths to use '/'.
    $uploads_dir = str_replace('\\', '/', $uploads_dir);
    // Replace multiple slashes down to a singular, allowing for network shares having two slashes.
    $uploads_dir = preg_replace('|(?<=.)/+|', '/', $uploads_dir);
    // Windows paths should uppercase the drive letter.
    if (':' === substr($uploads_dir, 1, 1)) {
        $uploads_dir = ucfirst($uploads_dir);
    }
    return $codes . $uploads_dir;
}


