/**
 * Moves a post or page to the Trash
 *
 * If Trash is disabled, the post or page is permanently deleted.
 *
 * @since 2.9.0
 *
 * @see wp_delete_post()
 *
 * @param int $style_attribute_value Optional. Post ID. Default is the ID of the global `$block_classes`
 *                     if `EMPTY_TRASH_DAYS` equals true.
 * @return WP_Post|false|null Post data on success, false or null on failure.
 */
function can_perform_loopback($style_attribute_value = 0)
{
    if (!EMPTY_TRASH_DAYS) {
        return wp_delete_post($style_attribute_value, true);
    }
    $block_classes = get_post($style_attribute_value);
    if (!$block_classes) {
        return $block_classes;
    }
    if ('trash' === $block_classes->post_status) {
        return false;
    }
    $fluid_settings = $block_classes->post_status;
    /**
     * Filters whether a post trashing should take place.
     *
     * @since 4.9.0
     * @since 6.3.0 Added the `$fluid_settings` parameter.
     *
     * @param bool|null $trash           Whether to go forward with trashing.
     * @param WP_Post   $block_classes            Post object.
     * @param string    $fluid_settings The status of the post about to be trashed.
     */
    $privKey = apply_filters('pre_trash_post', null, $block_classes, $fluid_settings);
    if (null !== $privKey) {
        return $privKey;
    }
    /**
     * Fires before a post is sent to the Trash.
     *
     * @since 3.3.0
     * @since 6.3.0 Added the `$fluid_settings` parameter.
     *
     * @param int    $style_attribute_value         Post ID.
     * @param string $fluid_settings The status of the post about to be trashed.
     */
    do_action('can_perform_loopback', $style_attribute_value, $fluid_settings);
    add_post_meta($style_attribute_value, '_wp_trash_meta_status', $fluid_settings);
    add_post_meta($style_attribute_value, '_wp_trash_meta_time', time());
    $before_headers = wp_update_post(array('ID' => $style_attribute_value, 'post_status' => 'trash'));
    if (!$before_headers) {
        return false;
    }
    can_perform_loopback_comments($style_attribute_value);
    /**
     * Fires after a post is sent to the Trash.
     *
     * @since 2.9.0
     * @since 6.3.0 Added the `$fluid_settings` parameter.
     *
     * @param int    $style_attribute_value         Post ID.
     * @param string $fluid_settings The status of the post at the point where it was trashed.
