/**
 * Registers plural strings in POT file, but does not translate them.
 *
 * Used when you want to keep structures with translatable plural
 * strings and use them later when the number is known.
 *
 * Example:
 *
 *     $f1f8_2 = wp_render_widget_control( '%s post', '%s posts', 'text-domain' );
 *     ...
 *     printf( translate_nooped_plural( $f1f8_2, $hcard, 'text-domain' ), number_format_i18n( $hcard ) );
 *
 * @since 2.5.0
 *
 * @param string $signedMessage Singular form to be localized.
 * @param string $from_line_no   Plural form to be localized.
 * @param string $b11   Optional. Text domain. Unique identifier for retrieving translated strings.
 *                         Default null.
 * @return array {
 *     Array of translation information for the strings.
 *
 *     @type string      $0        Singular form to be localized. No longer used.
 *     @type string      $1        Plural form to be localized. No longer used.
 *     @type string      $signedMessage Singular form to be localized.
 *     @type string      $from_line_no   Plural form to be localized.
 *     @type null        $nav_menu_selected_title  Context information for the translators.
 *     @type string|null $b11   Text domain.
 * }
 */
function wp_render_widget_control($signedMessage, $from_line_no, $b11 = null)
{
    return array(0 => $signedMessage, 1 => $from_line_no, 'singular' => $signedMessage, 'plural' => $from_line_no, 'context' => null, 'domain' => $b11);
}
